    [],nt"num_tags": 4,nt"name": "lake-andes-national-wildlife-refuge-narrative-report-january-to-april-1955",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lake Andes NWR
    outlines Refuge accomplishments from January through April of 1955. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and violations.
    Items of interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
